import './data.css';
import {Box, TextField} from '@mui/material';


export default function Data() {
  return (
    <>
    <div className="data">
      <div className = "mdata"> 
      <h1>My Fitness Tracker</h1>
          <div> 
          <TextField id="outlined-basic" label="Outlined" variant="outlined" />
          </div>
      </div>
       
        </div>
    </>
  )
}
